import { Box } from "./box.model";

export class TicketBox {
  name: string;
  boxes: Box[];
  superzahl: number | null;
  constructor(name: string, boxes:Box[],superzahl: number | null) {
    this.name = "default ticket name";
    this.boxes = boxes;
    this.superzahl = superzahl;
  }
}
